import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Dashboard() {
  const [data, setData] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (!userEmail) {
      navigate('/'); // Redirect to login if not logged in
      return;
    }

    const fetchData = async () => {
      try {
        const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
        const result = await response.json();
        setData(result);
      } catch (error) {
        console.error("Fetch error:", error);
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail'); // ✅ clear user email
    navigate('/'); // ✅ redirect to login
  };

  if (!data) return <div>Loading...</div>;

  return (
    <div>
      <h1>Dashboard</h1>
      <button onClick={handleLogout}>Logout</button>

      <h2>Weekly Commission</h2>
      {data.commissionData ? (
        <pre>{JSON.stringify(data.commissionData, null, 2)}</pre>
      ) : (
        <p>Loading commission data...</p>
      )}

      <h2>Scanning Violations & ARs</h2>
      {data.violationsData ? (
        <pre>{JSON.stringify(data.violationsData, null, 2)}</pre>
      ) : (
        <p>Loading violations data...</p>
      )}
    </div>
  );
}

export default Dashboard;
